import React from 'react';

import DogImg from '../assets/img/dogs/dog-appointment.png';

const Appointment = () => {
  return <section className='bg-yellow-secondary py-12 lg:pb-12 lg:mt-32 relative min-h-[584px]'>
    <div className='container mx-auto'>
      <div>
        <div>
          <img 
            src={DogImg} alt="dog"
          />
        </div>
        <form>
          <h2>Get an appointment</h2>
          <input type='text' />
          <input type='text' />
          <input type='text' />
          <button>Send</button>
        </form>
      </div>
    </div>
  </section>;
};

export default Appointment;
